import React, { useEffect } from "react"
import ReactDOM from "react-dom/client"
import {FetchPost} from "api/Api"
import {BrowserRouter } from "react-router-dom";










const App = () => {
    useEffect(() => FetchPost(), [])
    return (
        <div>
        Initial Render
        </div>
    )
}









const root = ReactDOM.createRoot(document.getElementById('app'))
root.render(
    <BrowserRouter>
    <App/>
    </BrowserRouter>
)
